Text:
@BigKev67 @davidsummers64 @ianrobo1 @gisby_marc @jennyah46 Top level sport is as much mental as technique. If you have a chink they'll find it.
No batsman likes the ball at his throat but the mentally strong find a way through.
Look at KP at the oval. All at sea before lunch, the Aussies smelt blood. Lee goes for him. KP fought back.
